@import 'grid';
@import 'typography';
@import 'navigation';

$text-black: #222222;
$grey-dark : #666666;
$grey-light: #999999;

$background-grey: #F5F5F7;
$primary-pink: #FF103D;

section.landing{
    width: 100%;
    height: 100vh;
    display: flex;
    background-color: white;
    z-index: 11;
    flex-direction: column;

    navbar{
        position: absolute;
    }

    .cover-section{
        display: flex;
        width: 100%;
        margin-top: auto;
        margin-bottom: auto;

        .hero-text{
            align-items: center;
            margin-top: 20px;

            h1{
                grid-column:1/3;
                grid-row: 1;
                z-index: 7;
                margin-top: 0px;
                margin-bottom: 0px;
            }

            .ampersand{
                font-family: $kansas;
                font-weight: 300;
            }

            .circles{
                position: relative;
                grid-column:2/3;
                grid-row: 1;
                z-index: 5;
                transition: 1s;

                .circle-1{
                    margin-right: 10%;
                    width: 90%;
                    padding-top: 90%;
                    border-radius: 100%;
                    transform: rotate(10deg);
                    opacity: 0.39;
                    background-image: linear-gradient(53deg, #ffffff 16%, #7b53fd 66%, #eb5454 87%, #b4ec51 87%, #eb5454 87%);
                }
                .circle-2{
                    position: absolute;
                    margin-right: 10%;
                    top: 0;
                    width: 90%;
                    padding-top: 90%;
                    border-radius: 100%;
                    opacity: 0.45;
                    filter: blur(40px);
                    background-blend-mode: multiply;
                    background-image: linear-gradient(53deg, #ffffff 18%, #18bbce 46%, #de0082 86%, #b4ec51 86%, #eb5454 86%);
                }
            }

            .intro-text{
                grid-column: 2/3;
                grid-row: 2;
                margin-top: 40px;

                p{
                    color: $grey-dark;
                    font-weight: 300;
                    line-height: calc(26px + (32 - 24) * ((100vw - 320px) / (1680 - 320)));
                    max-width: 90%;
                    margin-right: 10%;
                }
            }
        }


    }
}

@media screen and (max-width: 1280px) {
    section.landing{
        height: 70vh;
        background-color: $background-grey;
        .cover-section{
            .hero-text{

                h1{
                    grid-column: 1/1;
                }

                .circles{
                    display: none;
                }
            }

            .intro-text{
                grid-column: 1/2 !important;
                margin-top:0px !important;

                p{
                    margin-top: 20px;
                    margin-bottom: 0px;
                    max-width: 100% !important;
                    margin-right: 0% !important;
                }
            }
        }
    }
}

@media screen and (max-width: 600px) {
    section.landing{
        height: 80vh;
    }
}

section.projects{
    padding: 160px 0px;

    .projects-heading{
        h3{
            font-weight: 100;
            margin-top: 0px;
            margin-bottom: 0px;
        }
    }

    .project-listing-row{
        padding:80px 0px;

        .projects-row{  
            .project{
                position: relative;
                .image-container{
                    overflow: hidden;

                    img{
                        width: 100%;
                        transition: all 0.6s ease-in-out;
                        transform: scale(1.06);
                    }
                }

                .project-title{
                    position: relative;
                    display: inline-block;

                    h6{
                        font-weight: 200;
                        margin-top: 16px;
                        margin-bottom: 0px;
                    }

                    h6:before{
                        content: "";
                        position: absolute;
                        width: 0;
                        height: 2px;
                        bottom: -6px;
                        left: 0;
                        background-color: $text-black;
                        visibility: hidden;
                        transition: all 0.4s ease-in-out;
                    }
                }
            }

            .project:hover {
                .image-container{
                    img{
                        transform: scale(1.12);
                    }
                }

                .project-title{
                    h6:before {
                        visibility: visible;
                        width: 100%;
                    }
                }
            }
        }

        .projects-row-1, .projects-row-3{
            margin-left: auto;
        }

        .projects-row-2{
            margin-left: 0;
        }
    }

    .row-3{
        padding-bottom: 0px;
    }
}

@media screen and (max-width: 1280px) {
    section.projects{
        padding: 120px 0px;

        .project-listing-row{
            padding:60px 0px;
        }

        .row-3{
            padding-bottom: 0px;
        }

    }
}

